from typing import List, Tuple

class Solution:
    def largestRectangleArea(self, heights: List[int]) -> int:
        maxArea = 0
        stack = [] #(index, height)
        heightsCount = len(heights)

        for i in range(heightsCount):###enumerate(heights)---> i, h
            h = heights[i]
            start = i
            while stack and stack[-1][1] > h:#如果陣列裡面都是最大的友就是斜率都是正的時
                ind, hei = stack.pop()
                maxArea = max(maxArea, hei * (i - ind))#算矩形
                start = ind#將位置換成前面的 這樣下面的迴圈就可以把最小值全部檢查過
            stack.append((start, h))

        for ind, hei in stack:
            maxArea = max(maxArea, hei * (heightsCount - ind))

        return maxArea
    def findXLeg(self, matrix: List[List[str]], ind: Tuple[int, int]) -> int:
        '''
        找出已那個點為基準的長條圖
        '''
        n = len(matrix[0])
        x = ind[0]
        y = ind[1]
        rlt = 1
        i = x + 1
        while i < n and matrix[y][i] == '1':
            rlt += 1
            i += 1
        return rlt

    def findRect(self, matrix: List[List[str]], ind: Tuple[int, int]) -> int:
        m = len(matrix)
        x = ind[0]
        y = ind[1]
        xLegs = []

        i = y
        while i < m and matrix[i][x] == '1':
            xl = self.findXLeg(matrix, (x, i))
            xLegs.append(xl)
            i += 1
        return self.largestRectangleArea(xLegs)#去找最大矩形

    def maximalRectangle(self, matrix: List[List[str]]) -> int:
        m = len(matrix)
        n = len(matrix[0])
        maxArea = 0
        
        for j in range(n):
            isRun = False#檢查每一排的的值 如果有 1 下去找矩形
            for i in range(m):
                if isRun and matrix[i][j] == '0':#如果找過的 中間有 0 隔開重新找
                    isRun = False
                if isRun:
                    continue
                if matrix[i][j] == '1':
                    rect = self.findRect(matrix, (j, i))
                    if maxArea < rect:
                        maxArea = rect
                    isRun = True
                
        return maxArea


